import axios from 'axios';

// 直接返回对象
export const logIn = () => ({
  type: 'log'
})

const changeLoginState = (id) => ({
  type: 'change_list',
  id: id
})

export const getList = () => {
  return (dispatch) => {
    axios.get('/api/headerList.json').then((res) =>{
      const id = res.id;
      console.log(id.id)
      dispatch(changeLoginState(id.id))
    }).catch(() => {
      console.log('error');
    })
  }
}
